// frontend/src/App.js
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { ThemeProvider, createTheme } from '@mui/material';
import Navbar from './components/Layout/Navbar';
import Home from './components/Home/Home';
import Login from './components/Auth/Login';
import Register from './components/Auth/Register';

// Create theme
const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#DC143C', // Crimson red
      light: '#FF4D6A',
      dark: '#B30F32',
    },
    secondary: {
      main: '#1A1A1A', // Very dark gray
      light: '#2C2C2C',
      dark: '#000000',
    },
    background: {
      default: '#121212', // Dark background
      paper: '#1E1E1E',  // Slightly lighter dark
    },
    text: {
      primary: '#FFFFFF',
      secondary: 'rgba(255, 255, 255, 0.7)',
    },
    error: {
      main: '#FF6B6B',
    },
    success: {
      main: '#4CAF50',
    },
    divider: 'rgba(255, 255, 255, 0.12)',
  },
  typography: {
    fontFamily: [
      '-apple-system',
      'BlinkMacSystemFont',
      '"Segoe UI"',
      'Roboto',
      '"Helvetica Neue"',
      'Arial',
      'sans-serif',
    ].join(','),
    h1: {
      fontWeight: 500,
      letterSpacing: '-0.02em',
      fontSize: '3.5rem',
    },
    h2: {
      fontWeight: 500,
      letterSpacing: '-0.01em',
      fontSize: '2.5rem',
    },
    h3: {
      fontWeight: 500,
      letterSpacing: '-0.01em',
      fontSize: '2rem',
    },
    h4: {
      fontWeight: 500,
      letterSpacing: '0.01em',
      fontSize: '1.75rem',
    },
    h5: {
      fontWeight: 500,
      letterSpacing: '0.01em',
      fontSize: '1.5rem',
    },
    h6: {
      fontWeight: 500,
      letterSpacing: '0.01em',
      fontSize: '1.25rem',
    },
    body1: {
      fontSize: '1rem',
      letterSpacing: '0.01em',
      lineHeight: 1.6,
    },
    body2: {
      fontSize: '0.875rem',
      letterSpacing: '0.01em',
      lineHeight: 1.6,
    },
    button: {
      letterSpacing: '0.02em',
      fontWeight: 500,
      textTransform: 'none',
    },
  },
  components: {
    MuiAppBar: {
      styleOverrides: {
        root: {
          backgroundColor: '#1A1A1A',
          borderBottom: '1px solid rgba(255, 255, 255, 0.12)',
        },
      },
    },
    MuiButton: {
      styleOverrides: {
        root: {
          borderRadius: 8,
          padding: '8px 24px',
          fontSize: '0.9375rem',
          minHeight: 42,
          transition: 'all 0.2s ease-in-out',
        },
        contained: {
          background: 'linear-gradient(45deg, #DC143C 30%, #FF4D6A 90%)',
          '&:hover': {
            background: 'linear-gradient(45deg, #B30F32 30%, #DC143C 90%)',
            boxShadow: '0 0 10px rgba(220, 20, 60, 0.4)',
            transform: 'translateY(-1px)',
          },
        },
        outlined: {
          borderColor: 'rgba(220, 20, 60, 0.5)',
          '&:hover': {
            borderColor: '#DC143C',
            backgroundColor: 'rgba(220, 20, 60, 0.08)',
          },
        },
      },
    },
    MuiCard: {
      styleOverrides: {
        root: {
          backgroundColor: '#1E1E1E',
          borderRadius: 12,
          border: '1px solid rgba(255, 255, 255, 0.12)',
          transition: 'all 0.2s ease-in-out',
          '&:hover': {
            border: '1px solid rgba(220, 20, 60, 0.5)',
            boxShadow: '0 4px 20px rgba(0, 0, 0, 0.25)',
          },
        },
      },
    },
    MuiTextField: {
      styleOverrides: {
        root: {
          '& .MuiOutlinedInput-root': {
            '& fieldset': {
              borderColor: 'rgba(255, 255, 255, 0.23)',
              transition: 'all 0.2s ease-in-out',
            },
            '&:hover fieldset': {
              borderColor: 'rgba(220, 20, 60, 0.5)',
            },
            '&.Mui-focused fieldset': {
              borderColor: '#DC143C',
            },
          },
          '& .MuiInputLabel-root': {
            color: 'rgba(255, 255, 255, 0.7)',
          },
          '& .MuiInputBase-input': {
            color: '#FFFFFF',
          },
        },
      },
    },
    MuiPaper: {
      styleOverrides: {
        root: {
          backgroundColor: '#1E1E1E',
          backgroundImage: 'none',
        },
      },
    },
    MuiLink: {
      styleOverrides: {
        root: {
          color: '#DC143C',
          '&:hover': {
            color: '#FF4D6A',
          },
        },
      },
    },
    MuiCssBaseline: {
      styleOverrides: {
        body: {
          backgroundColor: '#121212',
          scrollBehavior: 'smooth',
        },
      },
    },
  },
  shape: {
    borderRadius: 8,
  },
  shadows: [
    'none',
    '0px 2px 4px rgba(0, 0, 0, 0.2)',
    '0px 4px 8px rgba(0, 0, 0, 0.2)',
    // ... add more shadow definitions if needed
  ],
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Router>
        <div className="App" style={{ 
          backgroundColor: theme.palette.background.default,
          minHeight: '100vh',
          color: theme.palette.text.primary
        }}>
          <Navbar />
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/login" element={<Login />} />
            <Route path="/register" element={<Register />} />
          </Routes>
        </div>
      </Router>
    </ThemeProvider>
  );
}

export default App;
